import React, { useEffect, useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const Login = () => {
    const [apiKey, setApiKey] = useState('');
    const [error, setError] = useState('');

    const fetchApiKey = async () => {
        try {
            const response = await axios.get('http://localhost:9001/apiKey', {
                headers: {
                    'username': 'tu_usuario', // Cambia esto por el nombre de usuario que necesites
                },
            });
            setApiKey(response.data.apiKey); // Ajusta esto según la estructura de tu respuesta
        } catch (err) {
            console.error('Error al obtener la API Key:', err);
            setError('Error al obtener la API Key'); // Manejo de error
        }
    };

    useEffect(() => {
        fetchApiKey();
    }, []);

    return (
        <div className="container mt-5">
            <h2>Iniciar Sesión</h2>
            {error && <div className="alert alert-danger">{error}</div>}
            <div>
                <p>API Key: {apiKey}</p>
            </div>
        </div>
    );
};

export default Login;
